import {
  PagesTopTitle,
  UserName,
  InfoCard,
  EmployeesChart,
} from "../components/Pages/Dashboard/index";
import { useState } from "react";
import { BiChevronDown } from "react-icons/bi";
const Dashboard = () => {
  const [userBreks, setUserBreks] = useState(true);
  const changNameUser = () => {
    setUserBreks(!userBreks);
  };
  return (
    <>
      <div className="custom_container">
        <UserName />
        <PagesTopTitle title="dashbaord" />
        <InfoCard />
        <EmployeesChart />
        <span className="user_breks_menu" onClick={changNameUser}>
          <BiChevronDown />
        </span>
        <div className={`${userBreks ? "online4" : "offline4"}`}>
          <div>dddd</div>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
